import React from 'react'
import Box from '@mui/material/Box';

function StatisticCard() {
  return (
    <Box 
        height={262}
        width={161}
        my={4}
        display="flex"
        alignItems="center"
        gap={4}
        p={2}
        color={'grey'}
        >
      
    </Box>
  )
}

export default StatisticCard
